INSERT INTO `wallpaper_subject` VALUES (48, 'Fate/Grand Order', '我已经不会再被欺骗了。<br>也不容许再被背叛了。<br>说起来也根本听不到主的声音。<br>既然听不到主的声音，<br>那就代表主早已对这国家失去信任了。<br>将所有邪恶聚集于此，报仇的时刻来临了！<br>这套片从白天拍到晚上地铁末班车都没了，高跟鞋走路走到最后恨不得光脚走，摄影和后勤真的非常辛苦了！一直陪着战斗到了最后，还有后期排版妆娘都是些什么神仙太太，简直吹爆，希望准备了很久的这套大家能喜欢，祝大家周末愉快~', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/48/f5e04ca0b4671b7d4fd989bb581fc46f45f2f7d3.jpg', 1, 'Fate/Grand Order', '2019-04-23 10:29:24.287585', 0, '6681516480388923659', 'bcy', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/48/636bafb464830c2e2bf207ecedd7ab21f67a718b.jpg', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/48/207cfb97e3171627faaae58b4def49854a480eee.jpg');
