INSERT INTO `wallpaper_subject` VALUES (216, '崩坏学园', '【正片】#崩坏3rd##全员#<br>【麻烦喜欢的天使可以点下赞吗( ?▽` )?】<br><br>“即使被硝烟所淹没，也仍一往向前。”<br>“为世界上的所有美好而战。”<br>“因为我就是，琪亚娜· 卡斯兰娜！”<br>“我不会抛弃你的琪亚娜，就像你从未抛弃我一样！”<br>“除了战斗之外bronya一无所有。”<br>“舰长，喜欢樱花吗？来年的春天一起去赏樱吧。”<br>“终幕的号角早已响起。”<br>“今天也全力以赴，守护着世界。”<br>“不足挂齿。”<br>“真想…再喝一杯啊….”<br><br><br>琪亚娜【圣女祈祷】：黑二 （微博：伐檀小二黑）<br>芽衣【强袭】：卿谷 （微博：不可以吃的谷子_）<br>布洛尼娅【银狼的黎明】：仓九@仓九仓九大仓鼠 <br>八重樱【逆神巫女】：安子熙@安子熙<br>卡莲【修女】：夏澜枫（微博：夏澜枫_<br>符华【青燕化羽】：唐浊言（微博：爆裂鼓手清清清）<br>德丽莎【樱火轮舞】：白二（我）<br>姬子【战场疾风】：影子（微博：不会玩微博的影子）<br>摄影：果酱 @拼命三郎果酱 <br>后期：宫野七 @宫野七<br>排版：圣沐 <br>妆娘：尸菌 <br>后勤：章子 柚子 唐沐 阿酪<br><br><br>跨度将近一年的片子！经历了很多困难终于产出来了！！！感谢各位大佬的助力呜呜呜，全都是大佬！！摄影后期排版请找他们约！后勤的几位大佬真的帮了超级多的忙！各位团员也久等啦，感谢你们还没有打我呜呜呜<br><br>没有丽塔双子和希儿是因为拍的时候还有出来着，希望各位看官理解_(:з)∠)_争取有生之年可以圆一次大全员叭<br><br>最后！喜欢劳K！祝福各位舰长单抽出希儿！十连能毕业！爱您！', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/216/7201fa5377cb47c09e150f32a06719b8acdf4013.jpg', 1, '崩坏学园', '2019-05-29 10:27:42.559545', 0, '6694873994434183437', 'bcy', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/216/635dee07298aca0304597138643cb9b7e90b138c.jpg', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/216/ea18d8fc709f4d54f3fc52f4b7134e3105807d55.jpg');
