INSERT INTO `wallpaper_subject` VALUES (430, '英雄联盟', '#cos正片##英雄联盟##玉剑传说##舞剑仙##艾瑞莉娅#<br> <br> 山洪恣意，不过强人；<br> 静水流深，方为强者。<br><br>出镜：徴水渊【我】<br>摄影：@野川森屿SnaKyo <br>后期：@深濑一光 <br>排版：思<br>后勤：我爸妈<br>社团：透明公馆<br>————————-碎碎念———————-<br>谢谢大家在各方面对我的帮助，发片前不久也发生了一些很糟心的事【就是被槽不配出艾瑞莉娅，出她是侮辱lol这类的话。说的一些话很难听我就不在这里讲了】这套片我知道有很多不足，首先就是假发，前一天我真的把造型做好了，第二天早上还上了发蜡，去沙滩之前前后头发都喷了摩丝，喷了很多很多很多，感觉得有半瓶？但是海边的风真的太大了，六七级的风，造型真的撑不住，最后刘海上其实都别了一字夹。这点我很抱歉。还有就是因为这个风，我在海边其实很难站稳，导致很多动作实现不了，修后期的时候才发现翻车了，所以一直在犹豫要不要放出来。差点被刮进海里也不是骗人的，两次吧，最惊险的一次是差点从礁石上摔下去，感觉自己在死亡的边缘反复试探。总之非常感谢森屿姐姐一直陪我受罪拍片；感谢我父母也一直陪着我，支持我去做想做的事情；感谢深濑太太用尽所有办法，尽可能帮我实现我想要实现的；感谢思太太排出这么精致的排版，非常感谢你们【鞠躬】', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/430/db83d27f2e1a3da1352375535cc102df8e4b1e46.jpg', 1, '英雄联盟', '2019-06-25 06:30:29.199734', 0, '6704840893502849287', 'bcy', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/430/2b2844e729f44ae5d187a31e92549c9ee5f6ceee.jpg', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/430/a51d0d7a0027190c0a6a10008c4b4449f89f01b1.jpg');
