INSERT INTO `wallpaper_subject` VALUES (532, '剑侠情缘网络版叁', '天宝二年，公孙大娘将忆盈楼更名为七秀坊，一时间，七秀坊成为与万花谷、长歌门齐名的大唐三大风雅之地。<br><br>每月会初一、十五之时，七秀坊便于水云坊内以剑舞会四方之客。<br><br>当夜幕降临，月上柳梢头，众人已纷纷歇下，却有一七秀女子撑伞缓缓走向那瘦西湖畔，待她入水现出鱼身，这才知晓她竟是由锦鲤化身而成。<br><br>传说锦鲤能给人带来好运，不知究竟哪位侠士能有此机缘，能与之相遇。<br><br>———————— 锦鲤————————————<br><br><br>出 镜：十易 <br>摄 影：淡淡<br>后 期：慕容莲卿<br>排版：鵇一叔<br>妆 造：自理<br><br><br>五月份拍的这套，半夜入水真的太痛苦了，尤其换上鱼尾后简直就是咸鱼一条，翻个身都难！整个人都在水里翻滚，还差点被冲走。。。。拍完回来就是感冒发烧拉肚子三连跪，不过只要能有套好片子就行！', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/532/fe635bc3c731fdd37240ddc54a59a203b31f5720.jpg', 1, '剑侠情缘网络版叁', '2019-06-28 19:07:57.240263', 0, '6706354656206913800', 'bcy', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/532/d1f86294fa29ec16e0b80d3536fde2784f7a3c18.jpg', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/532/9d335dc64c833c675542c62f92875c3d55211b4c.jpg');
