INSERT INTO `wallpaper_subject` VALUES (594, 'Re:从零开始的异世界生活', '—— 私 の 名 前 は エ ミ リ ア。た だ の エ ミ リ ア よ。——<br><br>艾米莉亚：伊伊@Astrid伊伊 <br>妆面：@千玑叽叽叽叽 <br>摄影：@熙熙子的小鱼干_w <br>后期：@伊水yis <br><br>距离拍这套片已经快过去3年了（什么你也好意思说）终于肯吐片了<br>感谢摄影陪我大老远跑磨山拍片！感谢伊水后期救我狗命！<br>顺便庆祝并期待一下动画第二季！E.M.T！', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/594/f6a71caaaad1239468784b7b85c6e06cf318882a.jpg', 1, 'Re:从零开始的异世界生活', '2019-07-01 19:03:50.303640', 0, '6707502058292920584', 'bcy', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/594/f99ff0d3bc7b14d48c310aeb9cd18f790caa957c.jpg', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/594/bdcad00e03d2be97f95f5b323ac7c145ba98a6c8.jpg');
INSERT INTO `wallpaper_subject` VALUES (604, '生化危机', '【cos预告】艾达王-生化危机<br><br>『艾达：这个世界有很多还是不知道的好，这就是其中之一。』<br>喜求k求k<br><br><br>出镜:蛋挞【原po】<br>phx:龙骑士<br>妆娘:大喵<br>后期:L<br>后勤:小嘤. sakura. 大喵<br>文案提供:樱花<br>服装来源:苏杭的租衣铺<br>coser社团:秋月白<br><br><br>这套片子是龙叔和我说了好久，我一直没弄到衣服，正好苏杭小姐姐那里有，就这么安排上了。夸爆小姐姐的衣服，特别新，还特意给我做了造型毛，毛上面都香香的。龙叔的拍摄技术一如既往的好，还车接车送，服务贼到位。担心我穿这么高的鞋一直提醒我。又拯救了我这个动作废。妆娘大喵还过来跟妆，给我后勤，画得超级好！！！人还美丽！！后勤这次一直都很忙，帮我扯裙子，扶着我，感谢sakura特意过来帮我，还用拍立得给我拍了几张。L的后期着实让我震惊，太好看了吧，感觉自己被拯救了！！！好喜欢！！吹爆！！<br>拍的好快乐好顺利好开心的一套片！<br>期待正片呀！', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/604/128fda8f1c34503b3bde224db8bb2ed8de63d5e5.jpg', 1, '生化危机', '2019-07-01 19:09:00.431184', 0, '6707409534924620045', 'bcy', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/604/99cdf01ac3c3d2847f4ba8871ae2e9772a8bb89f.jpg', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/604/fb852b0296d3c90ebe7ceeb498f4b22cd94a22c3.jpg');
