INSERT INTO `wallpaper_subject` VALUES (666, '生化危机', '【cos正片】艾达王-生化危机<br>『“此时此刻，我已经超越了同情心，我们已经超越了人性。”——艾达·王（生化危机6）<br><br>这个社会脆弱的外壳，很快就会崩溃！然后，你知道，这个社会会留下什么吗？........一片废墟，混乱不堪！我，艾达王，将会成为新世界的女王！”<br><br>　她曾对卡拉感到同情，当她看见克隆西蒙斯诞生之时，，她愤怒了，她无法容忍这已经扭曲的爱。这是我第一次看见女王的愤怒』<br><br>出镜:蛋挞【原po】<br>phx:龙叔（龙骑士）<br>妆娘:大喵<br>后期/排版:L，最后两张是大喵<br>后勤:小嘤 sakura 大喵<br>coser社团:秋月白<br><br>第一次出艾达王，有很多不足，打算有机会再重新出一次，这是龙叔找我拍的，算是替他圆梦，结果我却爱上了这个角色，想以后再找个机会好好诠释一下她。大喵小姐姐的妆好看，人也美丽。L告诉我这是他第一次排版，那我也告诉他这是我入圈多年第一次发排版的片子，他说还在学习阶段，但我很满意呀，真的特别喜欢，非常感谢他。后勤们都没少付出，很辛苦，但是我还是比较满意的，果然我还是适合出御姐哈哈哈。喜欢就麻烦帮忙K一下喽<br><br>后排卑微求看看我得团片。<br>也求看看秋月白社团？', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/666/7f96b61a53eaf5b2249edcdfe1973e365888c644.jpg', 1, '生化危机', '2019-07-04 19:00:42.827633', 0, '6708540618118791438', 'bcy', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/666/ac924704727e5ba3fdf64e8bdc01320e5fbbc755.jpg', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/666/75c98e864b9c67cf0113b7cd5748fd54580cb5e4.jpg');
