INSERT INTO `wallpaper_subject` VALUES (679, '阴阳师手游', '＃不知火正片＃<br><br><br><br>阿房碧辉煌 谣诼燃其堂<br>囚于笼中蝶 烬中涅槃生<br><br><br>数十年前に海に現れた大妖怪は<br>不知火と呼ばれています<br>数十年出现在海面的大妖怪 被叫做不知火<br><br><br>しかし、それはあくまでも伝説です<br>私はこの不吉な名前を与えられました<br>可那也不过是个传说 我却被赋予了这不详的名字<br><br><br>離人閣の舞台は私の存在意義を与えてくれました<br>同時に私の心をも封じ込めました<br>离人阁的舞台 给了我存在的意义 同时也禁锢着我的内心<br><br><br>名を慕ってやってきた遊覧船の漁火の光が<br>百数千と広がった<br>慕名而来的游船 渔火的灯光蔓延开来 成百上千<br><br><br>伝説の不知火を知らないように<br>就如同传说中的不知火一样<br><br><br>だんだん時間が私の目にもしびれてきました。<br>渐渐的时间在我眼中也变得麻木了<br><br><br>向远方<br>私はいつかこの灯火のように自由になれるだろうか？<br>我又什么时候可以像这些灯火一样的自由<br><br><br>妖怪に対する憎しみが花火となり<br>離人閣に火がついた<br>閉じ込められた蝶も含まれています<br>人们对于妖怪的仇恨 化为焰火点燃了离人阁<br>也包括了 被禁锢着的蝴蝶<br><br><br>長い年月の中で、阿离はもうないかもしれません<br>代わりに人々の口の中の不知火<br>在漫长岁月中 阿离或许早已不存在<br>取而代之的 是人们口中的不知火<br><br><br><br>私は やっと自由になりました<br>我 终于获得自由了<br><br><br><br>盈盈楼上女 惊鸿皆往昔<br>离离海下焰 无惜此身名<br><br><br><br><br><br>#出镜：原po cn：乙羽桃<br>#摄影&后期：@朴素君（神仙） <br>#后勤：@阿坤（茨木）,还有我的两个三次元同学233<br>＃文案：@炸米羽蓟娘（文案是个大佬）<br><br>PS：拍的时候蚊子超级多，还热hhhh但是多亏了后期小姐姐！！拍的很顺利！！比心！！！最后逼逼一句，喜劳扩~', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/679/126c7339d936b4310e9fc30cc8d19d6bf9302aa9.jpg', 1, '阴阳师手游', '2019-07-04 19:05:07.744480', 0, '6708595468315672844', 'bcy', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/679/0cdd2d9bf04e905c7ad148957b73b8898b79ca9d.jpg', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/679/0ce887d4ba2993f06b2173fab01020cf1bad9e22.jpg');
