INSERT INTO `wallpaper_subject` VALUES (684, '剑侠情缘网络版叁', '闺蜜送的生日贺图就是终于P完了两年前的剑三旅拍，这是最后一套。<br>这个是真的去昆仑山脉拍的，只有两人的新疆之旅，哈哈哈，不容易组合。我俩自己开车游历祖国大好河山也是一种乐趣。闺蜜说我就快攒齐一个人的剑三江湖了，哈哈哈好心酸。<br>新一岁的愿望就是希望以后有一个CP可以和我一起拍cos拍汉服，也希望闺蜜找到一个可以帮她扛相机的蓝朋友(?°3°?)<br><br>昆仑是什么，<br>是雪山，是圣湖，<br>是高飞的仙鹤，<br>是冰刺的冷风，<br>最重要的是我的家。<br><br>模特妆造@凡人-月影 <br>摄影后期 @大侠猩爷 <br>服装@东游记国风', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/684/08d87a03fcb70943df59f958ffe6cb18e3e11623.jpg', 1, '剑侠情缘网络版叁', '2019-07-04 19:06:47.761680', 0, '6708385252861018372', 'bcy', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/684/6cdfdb1cc7c6d56d88cd46adade3f71a18b4f1d1.jpg', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/684/3145e7cd5cc6861ad0c20f012c8919ab1f579b5b.jpg');
