INSERT INTO `wallpaper_subject` VALUES (714, '王者荣耀', '“聆听渴望的，深信珍视的，沉醉梦寐以求的。”<br><br><br><br><br>杨玉环：原po<br>phx：@雪敛X真的想拍JO <br>edit：@_好像是块豆腐_ <br>排版：椰子 豆腐<br>协力：@火热的勺子旋转跳跃 <br><br>旋转跪地感谢表白我们崽儿帮我后勤！！<br><br>————————————————————<br>拍的时候想了很多，出门忘记带最重要的荔枝，气爆。<br><br>美丽却也迷茫困惑，会挑衅“被铭记，是需要付出代价的。”也会被击败“此恨绵绵。”<br>琵琶的弦音是要迷惑自己吗？不，心神并没有动摇的迹象，只是自己真切从乐曲中感受到日夜梦想中最美好的长安盛世的模样。<br><br>“因为琵琶会让你听到内心渴望的，看到梦寐以求的。”<br>————————————————————<br>两张长条不知道能不能看出来...<br>一张是梦幻的困惑中手捧着金色的莲花，低眉信手续续弹却曲不成调，<br>一张是迷茫的现实中从屏风后走出来，阴暗不明且弹且歌，最后曲终人散<br>散片也都放进去啦，长条没有拼上所有的图奥~', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/714/ecfb461f74339b8fc7c90a591d3cdef5a6712270.jpg', 1, '王者荣耀', '2019-07-06 19:02:36.564151', 0, '6709384003956244747', 'bcy', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/714/db382a3631872d1119c5c605ded1f6a56050e879.jpg', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/714/3c92a3e01526baf66039b42846d6262cfc61eba2.jpg');
