INSERT INTO `wallpaper_subject` VALUES (753, '剑侠情缘网络版叁', '纯则粹，阳则刚<br>天行健，两仪遵道恒长<br>故有长久者，不自生方长生之讲<br><br>百丈风，松如浪<br>地势坤，厚德载物之象<br>故君子，不争炎凉<br><br>破军道姑：栖迟<br>妆造：栖迟<br>摄影：魂旦花<br>后期：叁岁<br>后勤：可爱的亲亲室友<br>排版：夏君<br><br>锵锵~终于出片啦~撒花！感谢摄影后期后勤排版小天使们！<br>啊成都的天气真的是难以捉摸……当天去拍摄的路上……下雨了QAQ到达拍摄地点的时候等我换好衣服突然就下大了，暴雨那种啊啊啊啊啊真的要哭出来了。不过还好等真正开始拍的时候就停啦，所以还是很给面子的！<br>本体道姑，当初入坑之前，就很喜欢纯阳这个门派了，还记得当时一个人晕头转向在纯阳地图磕磕绊绊升级，找不到副本入口在哪里，最后还是被一个妖道长捡到，带我进本还教会我跳山山QWQ不过没过多久就因为要高三A了，等我高考完再回来，尝试过各种职业，什么七秀万花苍云五毒藏剑……但是最喜欢的，还是纯阳的雪。<br>我生是纯阳宫的小绵羊，死是纯阳宫的烤全羊！<br><br>所以，要跟我回华山看雪吗？', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/753/436d2f63d069008a8d32256d9adf4dc65cb484bc.jpg', 1, '剑侠情缘网络版叁', '2019-07-08 19:00:03.399454', 0, '6709962778255294732', 'bcy', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/753/92ae47739890624c45bfd4dbbeda157740106f36.jpg', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/753/883ddcaebbeda2c5525fb3ba0a6fc3308a320c95.jpg');
INSERT INTO `wallpaper_subject` VALUES (754, '梦日记', '※2004.6.26——2019.6.26梦日记十五周年纪念※<br>————————————————————————<br><br>二度と朝には出会わない 窓の無い部屋で 動物が一匹<br>再也不与黎明相见 一匹动物独自在没有窗户的房间<br>ドアノブが壊れかけていて 触れたら最後 取れてしまいそうだ<br>门上的把手快要坏掉 仿佛轻轻一碰 它就会掉下来<br>二度と朝には出会わない 窓の無い部屋で 心臓がひとつ<br>再也不与黎明相见 一颗心脏独自在没有窗户的房间<br>目を閉じていても開いてみても 広がるのは 真っ黒な世界<br>无论睁开还是闭上 眼前蔓延的 始终是一片漆黑的世界<br>かくれんぼしてた 君を待ってた/取れたら最後 もう出られはしない<br>我仍在游戏中 等你来寻找我/一旦掉下来 就再也无法出去<br>出れたら最後 もう戻れはしない<br>一旦走出去 就再也不会回来<br><br>——BUMP OF CHICKEN《太陽》<br>————————————————————<br>coser/化妆/服装/后期：哑谜（po）<br>摄影：凯乐<br>特别感谢：@Underswap/chara @久织 @业火 @袖清枫 @动漫社社长 零 @空氣 <br>————————————————————<br><br>首先祝梦日记十五周年快乐', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/754/af1fab3f999815f5ce2883269b296f63fbfcf9d4.jpg', 1, '梦日记', '2019-07-08 19:00:51.001999', 0, '6710166180868391172', 'bcy', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/754/5b1f2caeeaa80a25f70efff82609e2a252f84ffb.jpg', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/754/8c5dfa3ffc51e40522409b6598eba35434203de5.jpg');
