INSERT INTO `wallpaper_subject` VALUES (942, '第五人格', '“诡异狂欢响彻庄园，破碎院落暗藏秘密”<br><br><br>    一封神秘的邀请函 一座废弃的庄园<br><br>    医生：我把你们救下来，并不是真的想带你们走，只是想让你们再体验一次绝望的滋味。<br><br>    园丁：猎人和猎物的身份转换，也许就在一瞬间.<br><br>    女巫：我并非是是神明，仅仅是半神的存在，我掌管着人类的梦境，因为他们害怕这种可以控制他们梦境的能力，因此过来让你实现你的愿望，你可愿意随我去我的梦之世界。<br><br>    杰克：开膛手杰克这个充满血腥的名字逐渐与伦敦的夜雾融为一体，人们开始害怕在夜间外出，毕竟没人能确定雾气中是不是一位杀人鬼<br><br>    错位的身份，错位的身体，错位的灵魂 <br><br>    ——错位的自我 <br><br>    或许一切都只是巧合 <br><br>    但巧合之外一定会有矛盾 <br><br>    如果矛盾不在于我，那就一定另有其人 <br><br>    而我必须抓出这幕后黑手<br><br>    你要找出真相？或许你对这里的一切一无所知。<br><br>         一切恐惧，源于未知。<br>    园丁：@白起夫人星雅<br>    医生：鹿林<br>    杰克：正宗 <br>    女巫：穆葵<br>    后期：@国王艾痴糖<br>    摄影没加。<br>    初物语的场照，久等了。', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/942/e8a74c6dc46b4f86085db91fb0600b620a4bc5a9.jpg', 1, '第五人格', '2019-07-16 02:57:34.079032', 0, '6710880755179847943', 'bcy', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/942/94839a74d396f372622478085a731d7f27eccefc.jpg', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/942/8ab9e9a7bc8c00796cbf43be00dac650d5cc76b9.jpg');
