INSERT INTO `wallpaper_subject` VALUES (991, '王者荣耀', '#王昭君 ? 精灵公主cos正片#<br>暖阳铺了一地<br>草木荼蘼<br>她点水而过<br>扰了一池澄澈 <br><br>宿命天成<br>生死是轮回<br>哀鸿遍野 横尸千里<br><br>便冰封吧<br>待尘埃落定<br>霜寒天 草木生<br>化蝶羽 金乌现 <br>介于生死之间<br>是人间第三种绝色<br><br>出镜：我（cn酥茶）<br>摄影&后期：西瓜 <br>妆造：@麟洛洛洛<br>排版：@喻御 <br>文案：阿潭 <br>囤了两个月终于发出来了，最后还是决定不加特效了，西瓜拍的太好看了，还有这个调色我爱了！<br>因为我的准备不足害得拍片那天状况百出，辛苦洛哥哥临时帮我做头饰，清歌跑了大老远帮我拿耳朵还帮我后勤，太感动了<br>然后我们三个一起在环球公园被蚊子咬到心情崩溃，回去以后数了一下我被咬了74个包，西瓜和清歌应该也差不多<br>第二次拍精灵公主的正片，感觉这一年来我变化还挺大的呢', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/991/5d58af611b0180f5ed6d591c18d77f6e539cc6e5.jpg', 1, '王者荣耀', '2019-07-17 19:02:20.971031', 0, '6713315083155407117', 'bcy', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/991/d8b04bb990258090d2f7a03bc6270133fb58377e.jpg', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/991/25d47f3143fd2b0e4f033818d36e61658ea0040b.jpg');
